/****** Object:  StoredProcedure [Guide].[spItemGroups]    Script Date: 9/28/2023 7:59:25 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE proc[Guide].[spItemGroups]
            @DisplayLength int,
            @DisplayStart int,
            @SortCol int,
            @SortDir nvarchar(10),
            @Search nvarchar(255) = NULL

            as
            begin
            Declare @FirstRec int, @LastRec int
            Set @FirstRec = @DisplayStart;
            Set @LastRec = @DisplayStart + @DisplayLength;

            With TBL as
            (
                 Select ROW_NUMBER() over(order by
            
             case when(@SortCol = 0 and @SortDir = 'asc')


                     then Name


                 end asc,
                     case when(@SortCol = 0 and @SortDir = 'desc')


                     then Name


                 end desc,
            		   case when(@SortCol = 1 and @SortDir = 'asc')


                     then Name


                 end asc,
                     case when(@SortCol = 1 and @SortDir = 'desc')


                     then Name


                 end desc,
            		   
		    
		       case when(@SortCol = 4 and @SortDir = 'asc')


                     then[CreatedDate]


                 end asc,
                     case when(@SortCol = 4 and @SortDir = 'desc')


                     then[CreatedDate]


                 end desc

              )

                 as RowNum,
             COUNT(*) over() as TotalCount
                ,format( [CreatedDate],'yyyy/MM/dd')AddedDate,
                [ID]
                ,[Name]
                ,[AddedBy]
                ,[ModifiedDate]
                ,[ModifiedBy]
                ,[IsDeleted]
                ,[IsActive]
                ,[DeletedDate]
                ,[DeletedBy]
            FROM[Guide].[ItemGrpoups] with (nolock)

             where(@Search IS NULL
                     Or[Name] like '%' + @Search + '%'
                     ) and IsDeleted = 0
		    		   )
            Select*
            from TBL
            where RowNum > @FirstRec and RowNum <= @LastRec

            end
