/****** Object:  StoredProcedure [Guide].[spProduct]    Script Date: 9/28/2023 7:59:25 PM ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE proc [Guide].[spProduct]
            @DisplayLength int,
            @DisplayStart int,
            @SortCol int,
            @SortDir nvarchar(10),
            @Search nvarchar(255) = NULL,
			@UserID uniqueidentifier = NULL


            as
            begin
                Declare @FirstRec int, @LastRec int
                Set @FirstRec = @DisplayStart;
            Set @LastRec = @DisplayStart + @DisplayLength;

            With TBL as
            (
                 Select ROW_NUMBER() over(order by
        
                     case when(@SortCol = 0 and @SortDir = 'asc')

					 
                     then p.BarcodeText


                 end asc,
                             case when(@SortCol = 0 and @SortDir = 'desc')


                     then p.BarcodeText


                 end desc,
        		               case when(@SortCol = 1 and @SortDir = 'asc')


                     then p.[Name]


                 end asc,
                             case when(@SortCol = 1 and @SortDir = 'desc')


                     then p.[Name]


                 end desc,
        		   
		
		               case when(@SortCol = 4 and @SortDir = 'asc')


                     then p.[CreatedDate]


                 end asc,
                             case when(@SortCol = 4 and @SortDir = 'desc')


                     then p.[CreatedDate]


                 end desc

              )
                 as RowNum,
                     COUNT(*) over() as TotalCount
                  ,format(p.[CreatedDate], 'yyyy/MM/dd')AddedDate,
                  p.[ID]
                  ,p.[Name]
                  ,p.[AddedBy]
                  ,p.[IsActive]
				  ,p.BarCodeText
                  ,p.[Image]
                  ,p.[Description]
				  ,p.[IdUnitOfQty]
				  ,p.[NameUnitOfQty]
            , p.QtyInStock
            , p.GroupId
                  , ig.[Name] GroupName
				  ,s.ID StockId
				  ,s.[Name]StockName

			  from Guide.Products p with (nolock)
				inner join Guide.StockProducts sp with (nolock) on sp.ProductId = p.Id
				inner join Guide.Stocks s with (nolock) on s.Id = sp.StockId
